content.query:
Event
| where EventLog == "{EventLogs2}"
| where Source == "{Source2}"
| where EventLog != "Security"
| summarize EventCount=count(Source) by TenantId, Source, EventID, RenderedDescription
| sort by EventID
//Event
//| where EventLog == "{EventLogs2}"
//| extend Pack=pack_all()
//| project TimeGenerated, EventLog, Computer, RenderedDescription, UserName, ["Details"]=Pack

